import React from "react";
import { NavLink } from "react-router-dom";

const Common = (props) => {
  return (
    <>
      <section id="banner-section">
        <div className="container">
          <div className="row">
            <div className="banner col-md-12 mx-auto">
              <div className="row">
                <div className="col-md-5 order-2 order-lg-1">
                  <h1>
                    {/* Grow Your Business with <strong>React</strong> */}
                    {props.title} <strong>{props.brand_name}</strong>
                  </h1>
                  <h2 className="my-3">
                    {/* We are the team of talented developer making websites */}
                    {props.subtitle}
                  </h2>
                  <div className="mt-3">
                    <NavLink exact to="/contact">
                      {/* Get Started */}
                      {props.link_content}
                    </NavLink>
                  </div>
                </div>
                <div className="col-md-7 banner_img_container order-1 order-lg-2">
                  <img
                    src="https://thapatechnical.github.io/reactlivewebsite/static/media/img2.e981619f.svg"
                    alt="banner-img"
                    className="banner_img float-center"
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Common;
